  false,\n\t\"url\": null,\n\t\"notes\": \"Water physical, chemical, and benthic organisms
  data were collected using current meter and bottle casts from the H.J.W.FAY and
  CAPE HENLOPEN from November 3, 1976 to September 15, 1977. Data were submitted by
  Virginia Institute of Marine Science - Gloucester Point, as part of the Ocean Continental
  Shelf - Mid Atlantic (OCS - Mid Atlantic) project. Data were processed by NODC to
  the NODC standard Water Physical and Chemistry (F014) and Benthic Organisms (F132)
  format. Full format descriptions are available from NODC homepage at http://www.noaa.nodc.gov.nnThe
  F014 format is designed to support studies of physical and chemical observations
  on the water column. Reported are measurements of temperature, salinity, conductivity,
  dissolved oxygen, nitrate, nitrite, ammonia, orthophosphate, and organic carbon.
  The format consists of four data record types, 80 characters in length, sorted by
  station and sequence numbers for proper order. The first nine columns for all records
  are to be used for file type (columns 1-3) and file identifier (columns 4-9). The
  file identifier, to be assigned by the originator, is an unique originator id for
  each data submission. After submission, the NODC reassigns to this field an unique
  NODC identifier for internal use.nnThe F132 format contains data from field sampling
  or surveys of bottom dwelling marine organisms. The data provide information on
  species abundance, distribution, and biomass; they may have been collected by point
  sampling (grab or core), by tow (dredge, trawl or net), by photographic surveys,
  or by other methods. Cruise information such as vessel, start and end dates, investigator,
  and institution/agency; station numbers, positions and times; and equipment and
  methods are reported for each survey. Environmental data reported at each sampling
  site may include meteorological and sea surface conditions; surface and bottom temperature,
  salinity and dissolved oxygen; and sediment characteristics. Number of individual
  organisms and total weight of organisms is reported for each species. A text record
  is available for comments.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
